import React, { Component } from 'react';
import {
  Image,
  Text,
  StatusBar,
  View,
  ScrollView,
} from 'react-native';
import Header1 from "./src/components/Header1";
import Card from './src/components/Card';
import Layout1 from './src/components/Layout1';


class App extends Component {

  componentDidMount() {
    StatusBar.setHidden(true);
 }

  render() {
     return(
      <View >
      <ScrollView>
      <Header1/>
      <Image 
        source={require('./assets/Covid19.png')}
      />
      <View>
      <Layout1/>
      </View>
      <ScrollView>
      <Card/>
      </ScrollView>
      </ScrollView>
      </View> 
    )
  }
};

export default App;
